INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24001, 24, "アヤネ", 0.0, 401, 2, 102301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 2, 0.0, "2030/12/17 14:59:59", 10046, 24002, 24, "アヤネ", 0.0, 402, 1, 102301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24003, 24, "アヤネ", 0.0, 403, 2, 102301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 1, 0.0, "2030/12/17 14:59:59", 10046, 24004, 24, "アサヒ", 0.0, 701, 2, 192201, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 2, 0.0, "2030/12/17 14:59:59", 10046, 24005, 24, "アサヒ", 0.0, 702, 1, 192201, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 1, 0.0, "2030/12/17 14:59:59", 10046, 24006, 24, "アサヒ", 0.0, 703, 2, 192201, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24007, 24, "部員３", 0.0, 801, 2, 192301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 2, 0.0, "2030/12/17 14:59:59", 10046, 24008, 24, "部員３", 0.0, 802, 1, 192301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24009, 24, "部員３", 0.0, 803, 2, 192301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("やった！", 0.0, 1, 0.0, "2030/12/17 14:59:59", 10046, 24010, 24, "", 0.0, 501, 1, 192501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("勝ったよ！", 0.0, 1, 0.0, "2030/12/17 14:59:59", 10046, 24011, 24, "", 0.0, 502, 1, 192501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい調子！", 0.0, 1, 0.0, "2030/12/17 14:59:59", 10046, 24012, 24, "", 0.0, 503, 1, 192501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 2, 0.0, "2030/12/17 14:59:59", 10046, 24013, 24, "ミサト", 0.0, 111, 6, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 2, 0.0, "2030/12/17 14:59:59", 10046, 24014, 24, "ミサト", 0.0, 112, 1, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24015, 24, "ミサト", 0.0, 113, 1, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 2, 0.0, "2030/12/17 14:59:59", 10046, 24016, 24, "ダイチ", 0.0, 611, 1, 192401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 2, 0.0, "2030/12/17 14:59:59", 10046, 24017, 24, "ダイチ", 0.0, 612, 1, 192401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 2, 0.0, "2030/12/17 14:59:59", 10046, 24018, 24, "ダイチ", 0.0, 613, 2, 192401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 1, 0.0, "2030/12/17 14:59:59", 10046, 24019, 24, "ハツネ", 0.0, 211, 2, 113401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 1, 0.0, "2030/12/17 14:59:59", 10046, 24020, 24, "ハツネ", 0.0, 212, 2, 113401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 2, 0.0, "2030/12/17 14:59:59", 10046, 24021, 24, "ハツネ", 0.0, 213, 1, 113401, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 2, 0.0, "2030/12/17 14:59:59", 10046, 24022, 24, "カヤ", 0.0, 311, 1, 106501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 2, 0.0, "2030/12/17 14:59:59", 10046, 24023, 24, "カヤ", 0.0, 312, 1, 106501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 1, 0.0, "2030/12/17 14:59:59", 10046, 24024, 24, "カヤ", 0.0, 313, 6, 106501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 3, 0.0, "2030/12/17 14:59:59", 10046, 24025, 24, "アヤネ", 0.0, 421, 4, 102301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 1, 0.0, "2030/12/17 14:59:59", 10046, 24026, 24, "アサヒ", 0.0, 721, 2, 192201, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 3, 0.0, "2030/12/17 14:59:59", 10046, 24027, 24, "部員３", 0.0, 821, 1, 192301, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい勝負だったよ\nまたやろうね", 0.0, 1, 0.0, "2030/12/17 14:59:59", 10046, 24028, 24, "", 0.0, 521, 1, 192501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 2, -360.0, "2030/12/17 14:59:59", 10046, 24029, 24, "ミサト", 0.0, 101, 1, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 2, -360.0, "2030/12/17 14:59:59", 10046, 24030, 24, "ミサト", 0.0, 102, 1, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 2, -360.0, "2030/12/17 14:59:59", 10046, 24031, 24, "ミサト", 0.0, 103, 2, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 1, -360.0, "2030/12/17 14:59:59", 10046, 24032, 24, "ミサト", 0.0, 104, 2, 113501, "2020/07/31 12:00:00");
INSERT INTO `v1_cd5e981c22a0f5542353157284755c5f57ff85d1ba67433bfa20f1a7ab97b5af` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 2, -360.0, "2030/12/17 14:59:59", 10046, 24033, 24, "ミサト", 0.0, 105, 1, 113501, "2020/07/31 12:00:00");
